import React from 'react';


function Button(props) {
    
    return(


            <div 
                className= {props.classname}
                onClick={() => props.onclick()}
                tabIndex = {props.tabindex}
            >    
                <span className={props.classname1}>{props.name1}</span>
                <span className={props.classname2}>{props.name2}</span>
                <span className={props.classname3}>{props.name3}</span>
            </div>

    )
}

export default Button
